const Home = (props: any) => {
  return (
    <div id="home-page" className="flex justify-center bg-red-500 h-screen w-full">
      <div id="search-section" className="flexw-full justify-center">
        <img className="absolute" src={require("")} alt="" />
        <input className="w-1/2" type="text"/>
      </div>
    </div>
  )
}

export default Home;
